import React from 'react'

class User extends React.Component {
	constructor() {
		super();
	}

	render() {
		return <tr key={this.props.index}>
                    <td>{this.props.name}</td>
                    <td>{this.props.surname}</td>
                    <td><input onChange={props.changeSalary.bind(this, index)} value={this.props.salary} style={{width: "30px"}} type="text" /></td>
                    <td><input onChange={props.changeDays.bind(this, index)} value={this.props.days} style={{width: "30px"}} type="text" /></td>
                    <td>{this.props.salary * this.props.days}</td>
                </tr>
    }
}

export default User;
